import React, { useState } from "react";
import Modal from "react-modal";
import Register from "./pages/register";
import { Link } from "react-router-dom";

import { Nav, NavLink, NavMenu, NavBtn, NavBtnLink } from "./NavbarElement";

Modal.setAppElement("#root");

function Navbar1() {
  const [] = useState("login");

  function Navbar() {
    const [isRegisterModalOpen, setRegisterModalOpen] = useState(false);

    const handleRegisterClick = () => {
      setRegisterModalOpen(true);
    };

    return (
      <div className="Index">
        <Nav>
          <Link to="/home">
            <img
              src="./images/sonnenspiele-logo.webp"
              alt="Logo"
              style={{ width: "auto", height: "50px", margin: "10px" }}
            />
          </Link>
          <NavMenu>
            <NavLink to="/products" activeStyle>
              Alle virtuelle Automatenspele!
            </NavLink>
            <NavLink to="/login" activeStyle>
              Anmelden
            </NavLink>
          </NavMenu>
          <NavBtn>
            <NavBtn>
              <NavBtnLink onClick={handleRegisterClick}>
                Registrieren
              </NavBtnLink>
            </NavBtn>
            <Modal
              isOpen={isRegisterModalOpen}
              onRequestClose={() => setRegisterModalOpen(false)}
            >
              {/* Sadr≈æaj modala za registraciju */}
              <Register />
            </Modal>
          </NavBtn>
        </Nav>
      </div>
    );
  }
}
export default Navbar;
